import React from 'react';

const Header = () => {
    return (
        <header className="bg-gray-900 text-white p-4">
            <div className="container mx-auto flex justify-between items-center">
                <h1 className="text-2xl font-bold">Book Exchange</h1>
                <nav>
                    <ul className="flex space-x-4">
                        <li><a href="#" className="hover:text-blue-500">Home</a></li>
                        <li><a href="#" className="hover:text-blue-500">Browse</a></li>
                        <li><a href="#" className="hover:text-blue-500">My Books</a></li>
                        <li><a href="#" className="hover:text-blue-500">Profile</a></li>
                    </ul>
                </nav>
            </div>
        </header>
    );
};

export default Header;
